import React from 'react';
import { Route, Redirect } from 'react-router-dom';

// import { authenticationService } from '@/_services';

const PrivateRoute = ({component: Component, roles, ...rest}) => (
	<Route {...rest} render={props => {
		console.log(props.location)
		if (!props.location) {
			return <Redirect to={{
					pathname: '/login',
					state: {
						from: props.location
					}
				}} />
		}

		if (props.location.state.user.school && props.location.pathname === '/teacher') {
			return <Component {...props} />
		}
		if (props.location.state.user.school && props.location.pathname === '/students') {
			return <Component {...props} />
		}
		if (props.location.state.user.class && props.location.pathname === '/student') {
			return <Component {...props} />
		}
	}}/>
)

export default PrivateRoute;
